import React from 'react';
import './App.css';
import SetSelection from './components/SetSelection';
import myImage from './images/logo.png';

function App() {
  return (
    <div className="App">
      <img src={myImage} alt="DraftStation" className="App-logo" />
      <h4>Magic the Gathering Drafting Simulator</h4>
      <p>Welcome to the DraftStation! Choose a set to draft and get started.</p>
      <SetSelection onStartDraft={handleStartDraft} />
    </div>
  );
}

const handleStartDraft = (setCode) => {
  console.log(`Starting draft for set ${setCode}`);
}


export default App;
